class TwitterComponent extends Component {
    constructor() {
        super();
        this.state = {
            accounts: []
        };
    }


    componentDidMount() {
        fetch('http://localhost:3001/tweets/')
            .then(res => res.json())
            .then(data => {
                this.setState(
                    (prevState) => { return { accounts: data.info } }
                )
            });
    }

    getData() {
        fetch('http://localhost:3001/tweets/')
            .then(res => res.json())
            .then(data => {
                console.log(data);
                this.setState(
                    (prevState) => { return { accounts: data } }
                )
            });
    }




    render() {
        this.getData.bind();

        console.log(this.state.accounts.statuses)

        return (
            <div id="main">
                <h1 align="center" >Other Reviews</h1>

                <div className="grid-container" style={{ marginTop: "2em", marginLeft: "40em" }}>
                    <div className="grid-child purple">
                        <div className="card  card-default" id="card_contacts">
                            <div id="contacts" className="panel-collapse collapse show" aria-expanded="true">
                                {this.state.accounts.body.map((items) => <span key={items.id} body>
                                    <div className="item">
                                        <span className="price">s{items.statuses.text}</span>
                                        {/* <span className="price">a{items.body}</span> */}
                                        {/* <p className="item-name">{items.description}</p> */}
                                    </div>
                                </span>)}


                                <ul className="list-group pull-down" id="contact-list" >

